const e=JSON.parse('{"key":"v-c35b93aa","path":"/lc3254.html","title":"3254. 长度为 K 的子数组的能量值 I","lang":"en-US","frontmatter":{"tag":"记忆化"},"headers":[],"git":{"createdTime":1730903269000,"updatedTime":1730903269000,"contributors":[{"name":"HouShengming","email":"18865290907@163.com","commits":1}]},"readingTime":{"minutes":0.99,"words":297},"filePathRelative":"lc3254.md","localizedDate":"November 6, 2024","excerpt":"<h1> 3254. 长度为 K 的子数组的能量值 I</h1>\\n<p>给你一个长度为 <code>n</code> 的整数数组 <code>nums</code> 和一个正整数 <code>k</code> 。</p>\\n<p>一个数组的 <strong>能量值</strong> 定义为：</p>\\n<ul>\\n<li>如果 所有 元素都是依次 <strong>连续</strong> 且 <strong>上升</strong> 的，那么能量值为 <strong>最大</strong> 的元素。</li>\\n<li>否则为 <code>-1</code> 。</li>\\n</ul>\\n<p>你需要求出 nums 中所有长度为 <code>k</code> 的子数组的能量值。</p>"}');export{e as data};
